				(if(f.type='pbx',ph.name,
				(if(f.type='mtracker',mt.name,
				(if(f.type='leads',l.name,''))))))))) as callername,
				f.type as groupname,
				f.followupdate as calltime,'' as status
				FROM 1_followup f
				LEFT JOIN 1_callhistory ch on (f.type='calltrack' AND f.callid=ch.callid)
				LEFT JOIN 1_ivrshistory ih on (f.type='ivrs' AND f.callid=ih.hid)
				LEFT JOIN 1_pbxreport ph on (f.type='pbx' AND f.callid=ph.callid)
				LEFT JOIN 1_leads l on (f.callid=l.leadid)
				LEFT JOIN 1_mtracker mt on (f.callid=mt.callid)
				WHERE f.type!='support' AND date(f.followupdate)>=CURDATE() 
				) a WHERE 1  ORDER BY a.calltime ASC  LIMIT 0,10
